<script>
import LastNews from "./LastNews.vue";
import Title from "./Title.vue";
import { CheckboxSvgMap } from "vue-svg-map";
// import SvgMap from "vue-simple-svg-map";
import USA from "@svg-maps/usa";
export default {
  data() {
    return {
      USA,
      dataForm: {
        ship_to: "",
        ship_from: "",
      },
      stateFrom: "",
      stateTo: "",
      allArticles: [],
      sliderActive: false,
      date: new Date(),
      selectedLocations: [],
      pointedLocation: null,
      tooltipStyle: null,
      currentMap: [],
      states: [],
      citiesData: [],
      cities: {
        to: [],
        from: [],
      },
    };
  },
  mounted() {
    this.__GET_STATES();
    this.__GET_ARTICLES();
    if (process.browser) {
      let svg = document.querySelector(".map_select");
      let rects = document.querySelectorAll(".map_state");
      rects.forEach((rect) => {
        rect.addEventListener("mouseenter", (e) => {
          svg.appendChild(rect);
        });
      });
    }
  },
  methods: {
    async __GET_ARTICLES() {
      this.sliderActive = true;
      this.allArticles = await this.$store.dispatch(
        "fetchArticles/getArticles",
        this.$i18n.locale
      );
      this.sliderActive = false;
    },
    async __GET_STATES() {
      this.states = await this.$store.dispatch(
        "fetchLocations/getStates",
        this.$i18n.locale
      );
    },
    pointLocation(event) {
      this.pointedLocation = event.toElement.dataset.name;
    },
    async mapClick(val) {
      (this.dataForm.ship_from = ""),
        (this.dataForm.ship_to = ""),
        await this.currentMap.push(val);
      if (this.currentMap.length > 2) {
        this.currentMap = await this.currentMap.slice(-2);
      }
      this.cities.from = await this.$store.dispatch(
        "fetchLocations/getCities",
        {
          state: this.currentMap[0],
        }
      );
      if (this.currentMap.length == 2) {
        this.cities.to = await this.$store.dispatch(
          "fetchLocations/getCities",
          {
            state: this.currentMap[1],
          }
        );
      }
      if (this.currentMap.length > 2) {
        this.currentMap = this.currentMap.slice(-2);
      }
    },
    async __GET_CITIES(id) {
      const citiesData = await this.$store.dispatch(
        "fetchLocations/getCities",
        {
          state: id,
        }
      );
      return city;
    },
    findCity(id) {
      return this.states.find((item) => item.code == id);
    },
    unpointLocation(event) {
      this.pointedLocation = null;
      this.tooltipStyle = { display: "none" };
    },
    moveOnLocation(event) {
      this.tooltipStyle = {
        display: "block",
        top: `${event.clientY + 20}px`,
        left: `${event.clientX - 15}px`,
      };
    },
    getLocationClass(location, index) {
      // Generate heat map
      return `svg-map__location svg-map__location--heat${index % 4}`;
    },
    sendCities() {
      if (process.browser) {
        localStorage.setItem("cities_from_map", JSON.stringify(this.dataForm));
      }
      this.$router.push("/location-map");
    },
  },
  components: { Title, LastNews, CheckboxSvgMap },
  watch: {
    selectedLocations(newVal, oldVal) {
      if (this.selectedLocations.length > 2) {
        this.selectedLocations = this.selectedLocations.slice(-2);
      }
    },
    async stateFrom(val) {
      this.dataForm.ship_from = "";
      this.cities.from = await this.$store.dispatch(
        "fetchLocations/getCities",
        {
          state: val,
        }
      );
    },
    async stateTo(val) {
      this.dataForm.ship_to = "";
      this.cities.to = await this.$store.dispatch("fetchLocations/getCities", {
        state: val,
      });
    },
  },
};
